using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;

namespace HTLib2.Bioinfo
{
    public partial class HSequence
	{
        /// Selecting lstPdbsSim30 in matlab as following way
        /// 
        /// 1. Q ← sort all 258 proteins whose residue number is >=60 (decreasing order)
        /// 2. S ← {}
        /// 3. while (Q is not empty)
        /// 4.   q ← pop from Q (removing the first(largest) element from Q, and return to q)
        /// 5.   add ← true
        /// 5.   forall (s in S)
        /// 6.     if (nwalign(s,q) > size(q)* 30%), then (add ← false)
        /// 6.   if (add == true), then (S ← S ∪ q)
        /// 7. return S
        /// 

        public static IList<Tuple<string, T>> GetListDissim<T>(IList<Tuple<string, T>> sequences, double similarity=0.3)
        {
            Tuple<string, object>[] seq1 = new Tuple<string, object>[sequences.Count];
            for(int i=0; i<sequences.Count; i++) seq1[i] = new Tuple<string, object>(sequences[i].Item1, sequences[i].Item2);

            Tuple<string, object>[] seq2 = GetListDissim(seq1, similarity).ToArray();

            Tuple<string,T>[] seq3 = new Tuple<string, T>[seq2.Length];
            for(int i=0; i<seq2.Length; i++) seq3[i] = new Tuple<string, T>(seq2[i].Item1, (T)(seq2[i].Item2));

            return seq3;
        }
        public static IList<Tuple<string, object>> GetListDissim(IList<Tuple<string, object>> sequences, double similarity=0.3)
        {
            int[] lstSeqLeng = new int[sequences.Count];
            for(int i=0; i<sequences.Count; i++) lstSeqLeng[i] = sequences[i].Item1.Length;

            Tuple<string, object>[] Q = sequences.HSelectByIndex(lstSeqLeng.HIdxSorted().HReverse());
            List<Tuple<string, object>> S = new List<Tuple<string, object>>();
            foreach(var q in Q)
            {
                bool add = true;
                foreach(var s in S)
                {
                    double score = Nwalign(s.Item1, q.Item1).Score;
                    if(score > q.Item1.Length * similarity)
                    {
                        add = false;
                        break;
                    }
                }
                if(add)
                    S.Add(q);
            }

            return S;
        }
    }
}

