function result = GetDissim(IdAllCaSeq, x)
    % sort Q by nres
    [~,Qi] = sort([IdAllCaSeq{:,3}]','descend'); Qi = Qi';
    % S = {}
    S = [];
    % iterate
    for qi = Qi
        if(length(S) == 0)
            S = [qi];
        else
            qseq = IdAllCaSeq{qi,4};
            bAddToS = true;
            for si = S
                sseq = IdAllCaSeq{si,4};
                sim = nwalign(sseq, qseq);
                if(sim > length(qseq)*x)
                    bAddToS = false;
                    break;
                end
            end
            if(bAddToS)
                S = [S, qi];
            end
        end
    end
    result = IdAllCaSeq(S,:);
end

